import React from 'react';
import Test from './Test';
import logoImage from './logo.png';
import './App.css'; /* Import your CSS file here */

const customStyle = {
  color: "red",
  /* fontShadow: "yellow", This property is not standard, use text-shadow instead */
  textShadow: "0 0 5px yellow", /* Add a yellow text shadow */
  fontFamily: "Times New Roman",
  fontWeight: "bold",
  /* padding: "0px 580px", Remove this if you want to use CSS for padding */
};

const App = () => {
  return (
    <header className="bg-light mb-4">
      <div className="container">
        <div className="d-flex align-items-center">
          <img src={logoImage} alt="Company Logo" className="mr-3" width="100" height="100" />
          <h1 style={customStyle} className="font-weight-bold">Aptitude Test</h1>
        </div>
        <Test />
      </div>
    </header>
  );
};

export default App;
